r, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1376","type":"LinearScale"},{"attributes":{},"id":"1479","type":"DatetimeTickFormatter"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{},"id":"1480","type":"AllLabels"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"format":"0.0b"},"id":"1364","type":"NumeralTickFormatter"},{"attributes":{"label":{"value":"read"},"renderers":[{"id":"1311"}]},"id":"1335","type":"LegendItem"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1550"},{"id":"1551"},{"id":"1552"},{"id":"1553"},{"id":"1554"},{"id":"1555"},{"id":"1556"},{"id":"1557"},{"id":"1558"},{"id":"1559"},{"id":"1560"},{"id":"1561"}]},"id":"1379","type":"DatetimeTicker"},{"attributes":{"url":"./profile?key=@name"},"id":"1138","type":"OpenURL"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_alpha":{"value":0.2},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1033","type":"Quad"},{"attributes":{},"id":"1435","type":"BasicTickFormatter"},{"attributes":{"coordinates":null,"formatter":{"id":"1495"},"group":null,"major_label_policy":{"id":"1496"},"ticker":{"id":"1379"}},"id":"1378","type":"DatetimeAxis"},{"attributes":{},"id":"1436","type":"AllLabels"},{"att
